import { useState } from 'react';

// Tutorial data from your JSON file
const tutorialData = [
  {
    "tutorialCategory": "Transport",
    "tutorials": [
      {
        "description": "Cab booking (Hindi)",
        "videoLink": "https://www.youtube.com/watch?v=Ho8qiFmNOlU",
        "uploadedBy": "userLC",
        "uploadedDate": "2025-05-06",
        "thumbnail": "https://i.ytimg.com/vi/uP_6Pts2GL4/hq720.jpg?sqp=-oaymwEhCK4FEIIDSFryq4qpAxMIARUAAAAAGAElAADIQj0AgKJD&rs=AOn4CLASciKuz1ez3C4gZ0uc9EunufHtKw"
      },
      {
        "description": "Cab booking (Telugu)",
        "videoLink": "https://www.youtube.com/watch?v=MlHUiIggEYA",
        "uploadedBy": "userLC",
        "uploadedDate": "2025-05-06",
        "thumbnail": "https://i.ytimg.com/vi/l2OsPGlDyfA/hqdefault.jpg"
      },
      {
        "description": "Cab booking (English)",
        "videoLink": "https://www.youtube.com/watch?v=pP8QezUqSO0",
        "uploadedBy": "userLC",
        "uploadedDate": "2025-05-06",
        "thumbnail": "https://i.ytimg.com/vi/xyQgptuIcpw/maxresdefault.jpg"
      }
    ]
  },
  {
    "tutorialCategory": "Food",
    "tutorials": [
      {
        "description": "Swiggy (Hindi)",
        "videoLink": "https://youtu.be/mJyOjygO9eU?feature=shared",
        "uploadedBy": "userLC",
        "uploadedDate": "2025-05-06",
        "thumbnail": "https://i.ytimg.com/vi/KGCC1XXDwws/maxresdefault.jpg"
      },
      {
        "description": "Swiggy (Telugu)",
        "videoLink": "https://youtu.be/JBp2H--OlBg?feature=shared",
        "uploadedBy": "userLC",
        "uploadedDate": "2025-05-06",
        "thumbnail": "https://i.ytimg.com/vi/3U7yIlRoYds/hq720.jpg?sqp=-oaymwEhCK4FEIIDSFryq4qpAxMIARUAAAAAGAElAADIQj0AgKJD&rs=AOn4CLDGrmwf_MfqrFi0Ervbbh3hOqGvNw"
      },
      {
        "description": "Swiggy (English)",
        "videoLink": "https://youtu.be/dY6_IjA-O9w?feature=shared",
        "uploadedBy": "userLC",
        "uploadedDate": "2025-05-06",
        "thumbnail": "https://i.ytimg.com/vi/orOdajUOC6o/hqdefault.jpg"
      }
    ]
  },
  // Other categories here...
];

// Helper function to extract YouTube video ID from URL
const getYoutubeVideoId = (url) => {
  const regExp = /^.*(youtu.be\/|v\/|u\/\w\/|embed\/|watch\?v=|&v=)([^#&?]*).*/;
  const match = url.match(regExp);
  return (match && match[2].length === 11) ? match[2] : null;
};

// Component to render a single tutorial card
const TutorialCard = ({ tutorial, onSelect }) => {
  return (
    <div 
      className="bg-white rounded-lg shadow-md overflow-hidden cursor-pointer transform transition hover:scale-105"
      onClick={() => onSelect(tutorial)}
    >
      <div className="relative pb-2/3">
        <img 
          src={tutorial.thumbnail || "/api/placeholder/320/180"} 
          alt={tutorial.description}
          className="w-full h-40 object-cover"
        />
      </div>
      <div className="p-4">
        <h3 className="text-lg font-medium text-gray-900">{tutorial.description}</h3>
        <p className="text-sm text-gray-500 mt-1">Uploaded: {tutorial.uploadedDate}</p>
      </div>
    </div>
  );
};

// Component to render YouTube embed
const YouTubeEmbed = ({ videoId }) => {
  if (!videoId) return null;

  return (
    <div className="aspect-w-16 aspect-h-9 w-full">
      <iframe
        className="w-full h-96 rounded-lg"
        src={`https://www.youtube.com/embed/${videoId}`}
        title="YouTube video player"
        frameBorder="0"
        allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
        allowFullScreen
      ></iframe>
    </div>
  );
};

// Filter tutorials by language
const filterByLanguage = (tutorials, language) => {
  if (!language || language === 'all') return tutorials;

  return tutorials.filter(tutorial => 
    tutorial.description.toLowerCase().includes(language.toLowerCase())
  );
};

// Main component for displaying tutorial categories and tutorials
const TutorialApp = () => {
  const [selectedTutorial, setSelectedTutorial] = useState(null);
  const [language, setLanguage] = useState('all');

  const handleSelectTutorial = (tutorial) => {
    setSelectedTutorial(tutorial);
  };

  const handleLanguageChange = (event) => {
    setLanguage(event.target.value);
  };

  return (
    <div className="container mx-auto p-4">
      <h1 className="text-2xl font-bold text-center mb-6">Tutorials</h1>

      <div className="mb-4">
        <select
          value={language}
          onChange={handleLanguageChange}
          className="p-2 border rounded"
        >
          <option value="all">All Languages</option>
          <option value="Hindi">Hindi</option>
          <option value="Telugu">Telugu</option>
          <option value="English">English</option>
        </select>
      </div>

      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
        {tutorialData.map((category) => (
          <div key={category.tutorialCategory}>
            <h2 className="text-xl font-semibold mb-4">{category.tutorialCategory}</h2>
            {filterByLanguage(category.tutorials, language).map((tutorial) => (
              <TutorialCard 
                key={tutorial.videoLink}
                tutorial={tutorial}
                onSelect={handleSelectTutorial}
              />
            ))}
          </div>
        ))}
      </div>

      {selectedTutorial && (
        <div className="mt-8">
          <h3 className="text-xl font-bold mb-4">Now Watching:</h3>
          <YouTubeEmbed videoId={getYoutubeVideoId(selectedTutorial.videoLink)} />
        </div>
      )}
    </div>
  );
};

export default TutorialApp;
